http://image.rakuten.co.jp/akibamac/cabinet/03274524/4547410266627.jpg<table border="0" cellpadding="0" cellspacing="0" width="710" style="line-height:140%;"><tr><td><font size="2">●プロフェッショナルなポートレート表現を可能にするための光学設計<br>オートフォーカスレンズでは、もっとも明るいF1.2 を実現。両面非球面レンズ1枚、異常分散レンズ2枚を含む8群11枚の新規設計の光学系を<br>採用しました。非球面レンズによって球面収差を良好に補正し、開放絞りから高い解像度を実現。<br>また、2枚の異常分散レンズと3枚の接合レンズの組み合わせにより、色収差を大きく低減しました。<br>レンズ全面に富士フイルム独自の多層コーティング処理「HT-EBC (High Transmittance Electron Beam Coating)」を採用。<br>ゴーストを抑え、シャープでクリアな描写を実現します。<br><br>円形7枚絞り羽根を採用。 XFレンズの特長の1つである滑らかな円形のボケを作り出します。<br>富士フイルムの光学設計技術を結集し、「Xシリーズ」に搭載されている独自の「X-Trans CMOS」センサー(ローパスフィルターレス)に<br>最適かつ最新の光学設計により超高画質を実現。逆光など過酷な環境下でもゴースト・フレアの発生を抑えます。<br>レンズの性能を最大限に引き出す「点像復元処理」に対応した「Xシリーズ」ボディと、本レンズとを組み合わせることで、<br>レンズごとの光学性能や特性を元に、回折現象などの光学的影響が補正され、画像のすみずみまで高いシャープネスやリアルな立体感が得られます。<br><br>●「Xシリーズ」搭載の「フィルムシミュレーション」機能との組み合わせで美しい階調表現を実現<br>レンズ交換式プレミアムカメラ「Xシリーズ」には、フィルムを選ぶ感覚で色彩・階調表現を使い分けられる「フィルムシミュレーション」機能を搭載しており、<br>多くのプロカメラマンから高い支持をいただいています。本レンズと、「フィルムシミュレーション」機能の中でもポートレート撮影専用に設計された<br>プロネガモード(2種類)を組み合わせることで、富士フイルムが80年に渡り培ってきた肌色の再現技術により、美しい階調表現が得られます。<br><br>●高速かつ静かなオートフォーカスの実現<br>フォーカシングシステムには、高速AFを実現するインナーフォーカス方式を採用。フォーカスレンズの軽量化と、高精度モーターの搭載により、<br>高速かつ静音なAFを実現しました。位相差AFに対応した「Xシリーズ」ボディと本レンズとを組み合わせることで、<br>より高速なAFで快適に撮影いただけます。<br>「Xシリーズ」ボディとの組み合わせでは、静かなシャッター音により、撮影する空間の雰囲気を壊すことなく、<br>被写体の自然な表情を引き出すことができます。<br><br>●高品位な外観と快適な操作性を実現<br>金属製のフォーカスリングと絞りリングを搭載。レンズボディ外装は金属部品を採用し、高品位な外観に仕上げました。<br>リングを廻すときの指先に伝わる質感と、適度なトルク感を重視し、繊細な操作が必要なマニュアルフォーカス時でも快適に撮影可能です。<br><br></font></td></tr></table><style type="text/css">
