Construction:18 Elements in 17 Groups  (including ED lens & 1 Aspherical lens)<br>Angle of view:75 deg.-34 deg.<br>F stop range:f2 - f22<br>Closest Focusing Distance:13.75 inches / 0.35m<br>Maximum Magnification:0.12x / 0.24x<br>Filter Size:77mm<br>Dimensions (Length x Diameter):4.8'' x 3.4'' (123 x 86mm)<br>Weight:32.25 ozz (915g)<br>Notes:Compatibility: Teleconverter EC-14: & Extension Tube EX-25:<br><br><br>The ZUIKO DIGITAL ED 14-35mm f/2.0 SWD  which covers a zoom range equivalent to 28mm to 70mm on a 35mm camera lens is the world's first standard zoom lens to feature a large f/2.0 aperture. Boasting industry-leading imaging performance  this lens is a worthy addition to the Olympus Super High Grade (SHG) series of lenses. Together with the ED 7-14mm f/4.0  ED 35-100mm f/2.0 and ED 90-250mm f/2.8 lenses  this lens completes Olympus' series of professional zoom lenses with fixed F-values <br><br> The flagship of the ZUIKO DIGITAL series  this lens was developed to meet the requirements of the most demanding professionals. It includes reliable splash- and dust-proofing  Olympus' exclusive SWD-driven ultra-fast AF system  a mechanically interlocked manual focusing mechanism and a large  petal-shaped hood with a polarization filter control window. <br><br> With its unique f/2.0 aperture providing bright viewing with a sharp subject and a soft blurring of the background  this lens epitomizes the versatility  power and creative freedom made possible by the Four Thirds System and is ideal for almost any application - from landscapes and portraits to indoor shooting and photojournalism.<br><br></DIV>
