Construction:10 Groups/ 14 Elements<br>Angle of view:26° 35'<br>F stop range:2.0-22<br>Closest Focusing Distance:9.1in. (0.23m)<br>Maximum Magnification:1:1<br>Filter Size:55mm<br>Dimensions (Length x Diameter):3.15 x 2.8in. (80 x 73mm)<br>Weight:13.8 oz. (388gm)<br><br><br>・World's first F2 Macro for APS-C DSLRs<br>・Longest working distance in its class (100mm)<br>・93mm equivalent on APS-C DSLRs* <br> *on an APS-C DSLR  Tamron uses 1.55X as an average<br>・Full-time manual control mechanism<br>・Two LD Glass elements<br>・Internal Focusing<br>・Ideal for portrait and macro shooting<br><br><br>The Tamron SP AF60mm F/2.0 Di II LD (IF) 1:1 Macro (model G005) is the first medium telephoto macro lens designed for APS-C size DSLR cameras that features a fast maximum aperture of F/2.0 one stop faster than the F/2.8 maximum aperture found on conventional macro lenses in the same class. <br><br> The SP AF60mm F/2.0 covers an equivalent angle of view of 93mm when converted to the 35mm format. With is fast F/2.0 maximum aperture  the new macro delivers dramatically attractive blurred background effects. And the addition of Internal Focusing (IF) and Full Time Manual Focus Control Mechanism to its list of highlight features makes this lightweight and compact 1:1 macro lens incredibly easy to use. For Canon  Nikon and<br><br></DIV>
