・A LensCoat for all seasons and habitats<br>・Forest Green Woodland Cameo<br>・Also Available in Realtree Hardwoods Snow & Advantage Max4 HD<br>・Sports shooters and photojournalist can get the benefits too<br>・Available in - Canon ''white'' and black<br><br><br>LensCoat Lens Covers... <br><br>Moving a big white (or black) lens near skittish wildlife is like waving your arms a sure way to flush your subject and ruin what could be a once-in-a-lifetime photo opportunity. LensCoat Lens Covers mask your 100 mm to 400 mm lens  giving you a better chance at getting the shot. <br><br> LensCoat Lens Covers are manufactured from 100% closed-cell neoprene  offering protection from bumps  jars and nicks  with a camouflage-pattern fabric cover. LensCoat Lens Covers also provide a thermal barrier  protecting your hands from cold lenses in lower temperatures. They are easy to install and remove  leaving no residue on the lens. And LensCoat lens covers are waterproof  providing protection in harsh conditions. <br><br> Other features include a clear  flexible UV-PVC window over the AF/IS/VR controls and the distance-scale window. The LensCoat also features custom holes that reveal the red-dot for easy alignment to the camera body without removing the cover. <br><br> The LensCoatTM 100-400 has small hole on the last segment lines up with the red dot indictor  making it easy to quickly line up your lens with camera mount evenwith the cover installed. <br><br> Please note that the The LensCoatTM Canon 100-400 IS cannot cover the fixed portion of the lens barrel due to the manner in which the lens barrel extends/retracts leaving approximately 3 inches exposed when the lens is fully extended. <br><br></DIV>
